DROP TABLE IF EXISTS `gnujiko_main_menu`;

CREATE TABLE `gnujiko_main_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `gid` int(11) NOT NULL,
  `_mod` varchar(3) NOT NULL,
  `name` varchar(64) NOT NULL,
  `icon` varchar(255) NOT NULL,
  `large_icon` varchar(255) NOT NULL,
  `url` varchar(255) NOT NULL,
  `ordering` int(11) NOT NULL,
  `published` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`,`gid`,`_mod`,`ordering`,`published`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `gnujiko_package_sections`;

CREATE TABLE `gnujiko_package_sections` (
  `name` varchar(80) NOT NULL,
  PRIMARY KEY (`name`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

