DROP TABLE IF EXISTS `gnujiko_packages`;

CREATE TABLE `gnujiko_packages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(80) NOT NULL,
  `version` varchar(64) NOT NULL,
  `section` varchar(80) NOT NULL,
  `maintainer` varchar(255) NOT NULL,
  `essential` tinyint(1) NOT NULL,
  `pre_depends` text NOT NULL,
  `depends` text NOT NULL,
  `replaces` text NOT NULL,
  `conflicts` text NOT NULL,
  `description` text NOT NULL,
  `installed_version` varchar(64) NOT NULL,
  `repository` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`,`section`)
) ENGINE=MyISAM AUTO_INCREMENT=512 DEFAULT CHARSET=latin1;

